MongoDB: Strange behaviour of sort with pagination leading to duplicates<p>Here I've just created a collection of 9 documents {id, name}.
All the documents have the same value &quot;A&quot; of the field <strong>name</strong>.</p>
<pre class="lang-js prettyprint-override"><code>[
  {
    &quot;name&quot;: &quot;A&quot;,
    &quot;id&quot;: 1
  },
  {
    &quot;name&quot;: &quot;A&quot;,
    &quot;id&quot;: 2
  },
  {
    &quot;name&quot;: &quot;A&quot;,
    &quot;id&quot;: 3
  },
  {
    &quot;name&quot;: &quot;A&quot;,
    &quot;id&quot;: 4
  },
  {
    &quot;name&quot;: &quot;A&quot;,
    &quot;id&quot;: 5
  },
  {
    &quot;name&quot;: &quot;A&quot;,
    &quot;id&quot;: 6
  },
  {
    &quot;name&quot;: &quot;A&quot;,
    &quot;id&quot;: 7
  },
  {
    &quot;name&quot;: &quot;A&quot;,
    &quot;id&quot;: 8
  },
  {
    &quot;name&quot;: &quot;A&quot;,
    &quot;id&quot;: 9
  }
]
</code></pre>
<p>I'm want to paginate this collection after sorting by name (<strong>it is useless to sort by name in my case, but I do that to prouve the strange behaviour</strong>), 3 by 3. (Page size is 3).</p>
<p>When I execute an aggregate pipeline with $skip 0, $limit 3 (first page):</p>
<pre class="lang-js prettyprint-override"><code>db.collection.aggregate([
  {
    &quot;$sort&quot;: {
      &quot;name&quot;: 1
    }
  },
  {
    &quot;$skip&quot;: 0
  },
  {
    &quot;$limit&quot;: 3
  }
])
</code></pre>
<p>The result is :</p>
<pre class="lang-js prettyprint-override"><code>[
  {
    &quot;_id&quot;: ObjectId(&quot;5a934e000102030405000000&quot;),
    &quot;id&quot;: 1,
    &quot;name&quot;: &quot;A&quot;
  },
  {
    &quot;_id&quot;: ObjectId(&quot;5a934e000102030405000001&quot;),
    &quot;id&quot;: 2,
    &quot;name&quot;: &quot;A&quot;
  },
  {
    &quot;_id&quot;: ObjectId(&quot;5a934e000102030405000002&quot;),
    &quot;id&quot;: 3,
    &quot;name&quot;: &quot;A&quot;
  }
]
</code></pre>
<p>And now when I want to get the following page ($skip 3, $limit 3), the result is:</p>
<pre class="lang-js prettyprint-override"><code>[
  {
    &quot;_id&quot;: ObjectId(&quot;5a934e000102030405000000&quot;),
    &quot;id&quot;: 1,
    &quot;name&quot;: &quot;A&quot;
  },
  {
    &quot;_id&quot;: ObjectId(&quot;5a934e000102030405000002&quot;),
    &quot;id&quot;: 3,
    &quot;name&quot;: &quot;A&quot;
  },
  {
    &quot;_id&quot;: ObjectId(&quot;5a934e000102030405000005&quot;),
    &quot;id&quot;: 6,
    &quot;name&quot;: &quot;A&quot;
  }
]

</code></pre>
<p>We remark that documents with ids 1 and 3 are extracted again. This ends up with a bad pagination (duplicates)!</p>
<p>How do you explain this, when sorting on non unique column leads to this strange behaviour?</p>
<p>To reproduce the problem <a href="https://mongoplayground.net/p/hP7CMtA3b2f" rel="nofollow noreferrer">https://mongoplayground.net/p/hP7CMtA3b2f</a></p>

