When I add this filter, I get an Exception stating:</p>

<blockquote>
  <p>Message: MongoDB.Driver.MongoCommandException : Command find failed: Too many geoNear expressions.</p>
</blockquote>

<p>Here is the first filter, </p>

<pre><code>
                var point = GeoJson.Point(GeoJson.Geographic(longitude: annEntityaAttr.CollectionLocation.Longitude,
                    latitude: annEntityaAttr.CollectionLocation.Latitude));
                filter = Builders&lt;AnnouncementEntity&gt;.Filter.Near(a =&gt; a.CollectionLocation, point, annEntityaAttr.MaxDistanceFromLocationInKM * metersFor1KM);
</code></pre>

<p>Here is how I add the second filter:</p>

<pre><code>var point = GeoJson.Point(GeoJson.Geographic(longitude: annEntityaAttr.DepositLocation.Longitude,
