Checking if field inside collection exists<p>I'd like to check if a value inside a field of a collection doesn't exist.</p>

<p>I tried both ways. Once checking if it does exist, that worked out fine, as far as I can tell: </p>

<pre><code>if (Characters.findOne({name:name})) {
      {throw new Meteor.Error('name exists');} };
</code></pre>

<p>It throws the error when you type in a name that already exists.</p>

<p>Now the other way around I tried</p>

<pre><code>   if (  Characters.find( { name: { $not: { $eq: name } } } ) ) {
    {throw new Meteor.Error('name doesn't exist');}
 };
</code></pre>

<p>I expected that the error would only throw if a name was given that doesn't exist. I commented the first code out of course. But it also threw the error when a name that did exist was passed in. </p>

<p>I tried a lot of different operators but the result was always the same.</p>

<p><strong>Edit</strong></p>

<p>I tried the suggested way and it worked fine!</p>

<p><strong>Case: Name does exist:</strong></p>

<pre><code>Meteor.methods({
  'characters.start'(name) {
   check(name, String);

if (Characters.findOne({name})) {
    throw new Meteor.Error('name exists');
} else {
 return Characters.insert({
      name,
      owner: Meteor.user().username,
      ownerId: Meteor.userId(),

    });
  }
},
</code></pre>

<p><strong>Case: Name doesn't exist:</strong></p>

<pre><code>Meteor.methods({
  'characters.start'(name) {
   check(name, String);

if (Characters.findOne({name})) {
 return Characters.insert({
      name,
      owner: Meteor.user().username,
      ownerId: Meteor.userId(),
      });
} else {
  throw new Meteor.Error('name exists');
  }
},
</code></pre>

<p>Thanks for the help!</p>

