Trying to output the name of a group and the size of the group (how many rows match the criteria)<p>So, i have a mongo database filled(21k enteries) with columns like action(there are 5 different actions) id, time, etc.</p>

<p>I need to get the name of every action, and how many times does this action occur. For example: USERPROPERTY_CHANGED - 755</p>

<p>I have tried pretty much everything in here <a href="https://stackoverflow.com/questions/18533080/laravel-eloquent-groupby-and-also-return-count-of-each-group">Laravel Eloquent groupBy() AND also return count of each group</a></p>

<p>Then i tried to make another collection, where i input the fields one, by one, and then fetch them, my migration looks like this:</p>

<pre><code>&lt;?php
use Illuminate\Support\Facades\Schema;
use Illuminate\Database\Schema\Blueprint;
use Illuminate\Database\Migrations\Migration;

class actionPopularity extends Migration
{
    public function up()
    {
        Schema::create('actionPopularity', function (Blueprint $collection) {
            $collection-&gt;Increments('id');
            $collection-&gt;string('action');
            $collection-&gt;integer('count');
        });
    }
    public function down()
    {
        Schema::dropIfExists('actionPopularity');
    }
}
</code></pre>

<p>But the collection that this generated had only one field - id.</p>

<p>heres something that kind of works (it shows that it can work with the database)</p>

<p><strong>Controller:</strong></p>

<pre><code>public function database_test()
{
    $actions = Action::groupBy('action')-&gt;get();

    return view('database_test',compact('actions'));
}
</code></pre>

<p><strong>View:</strong></p>

<pre><code>{{$actions}} 
</code></pre>

<p><strong>Output:</strong></p>

