        {
            "action":"OBJECT_MODIFY"
        },
        "action":"OBJECT_MODIFY"

    },
    {
        "_id":
        {
            "action":"null"
        },
        "action":"null"
    },
    {
        "_id":
        {
            "action":"USERPROPERTY_CHANGED"
        },
        "action":"USERPROPERTY_CHANGED"
    },
    {
        "_id":
        {
            "action":"OBJECT_DELETE"
        },
        "action":"OBJECT_DELETE"
    }
]
</code></pre>

<p>Ultimately i want to get two arrays, one with action names, and another one with the amount of times that this action has been called, to put it in a chart.</p>

